import { useState } from 'react'
let head = "data:image/jpeg;base64,"
let tail = "data:image/jpeg;base64,"


function CoinFlipping() {
    const [image,setImage1]=useState(head)
    const [headCount,setHead]=useState(0)
    const [tailCount,setTail]=useState(0)


    function random(){
       let random = Math.ceil(Math.random()*2)
       console.log(random)
       if(random==1){
        setImage1(head)
      setHead(  headCount+1)

            
       }else{
        setImage1(tail)
        setTail(tailCount+1)
       }
    }
  return (
    
    <>
    {<img src={image}  />}
            <button onClick={random}>Random</button>
            <p>tail is{tailCount}</p>
            <p>tail is{headCount}</p>

    </>
  )
}

export default CoinFlipping